This division covers the sciences and technologies supporting agriculture.
It includes:
• crop and pasture production;
• agronomy;
• horticultural production;
• animal production;
• forestry sciences;
• fisheries sciences; 
• food sciences; and,
• veterinary sciences.

This group covers the sciences and technologies supporting the production of crops, pastures and grains.
It includes:
• agronomy;
• genetics and field protection procedures for crop and pasture production;
• post harvest treatment transportation of crops and grains; and
• weed science
